import React from "react";
import { Container } from "react-bootstrap";
import Header from "../components/header";

const Landingpage = () => {
  return (
    <div style={{ backgroundColor: "#AAADC3", height: "1080px" }}>
      <Container>
        <Header />
              <div style={{ height: "599px", backgroundColor: "#12263A" }}>
                  <div></div>
                  <div></div>
        </div>
      </Container>
    </div>
  );
};

export default Landingpage;
